function printDiv(n){var t=document.getElementById(n).innerHTML,i=document.body.innerHTML;document.body.innerHTML=t;window.print();document.body.innerHTML=i}function downloadCSV(n,t){var r,i;r=new Blob([n],{type:"text/csv"});i=document.createElement("a");i.download=t;i.href=window.URL.createObjectURL(r);i.style.display="none";document.body.appendChild(i);i.click()}function exportTableToCSV(n){for(var u,i,t,f=[],e=document.querySelectorAll("table tr"),r=0;r<e.length;r++){for(u=[],i=e[r].querySelectorAll("td, th"),t=0;t<i.length;t++)i[t].innerText.includes("Edit")||u.push(i[t].innerText);f.push(u.join(","))}downloadCSV(f.join("\n"),n)}